DROP TABLE IF EXISTS `bb_order`;
CREATE TABLE `bb_order` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `username` varchar(32) DEFAULT NULL,
  `rider_id` varchar(32) DEFAULT NULL COMMENT '骑手id',
  `ridername` varchar(32) DEFAULT NULL,
  `goods_count` int(8) DEFAULT NULL COMMENT '商品数量',
  `store_id` varchar(32) DEFAULT NULL COMMENT '门店id',
  `storename` varchar(32) DEFAULT NULL,
  `order_id` varchar(64) DEFAULT '' COMMENT '订单编号',
  `goods_money` double(10,2) DEFAULT NULL COMMENT '商品总金额',
  `order_money` double(10,2) DEFAULT NULL COMMENT '订单总金额',
  `order_type` varchar(1) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '订单类型(0:送餐  1：店内用餐)',
  `user_address` varchar(32) DEFAULT NULL COMMENT '送餐地址',
  `used_phone` varchar(20) DEFAULT NULL COMMENT '用户电话',
  `rider_phone` varchar(20) DEFAULT NULL COMMENT '骑手电话',
  `user_coupons_id` varchar(32) DEFAULT NULL COMMENT '用户优惠券id',
  `invoice_flag` varchar(1) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT '0' COMMENT '是否需要发票(0:不开票 1:已开票)',
  `invoice_id` varchar(32) DEFAULT NULL COMMENT '发票id',
  `order_src` varchar(1) DEFAULT NULL COMMENT '订单来源(0:微信1:安卓app 2:苹果app 3:)',
  `invoice_open` varchar(1) DEFAULT NULL COMMENT '发票是否已开',
  `order_remark` varchar(64) DEFAULT NULL COMMENT '订单备注',
  `get_time` datetime DEFAULT NULL COMMENT '骑手取餐时间',
  `over_time` datetime DEFAULT NULL COMMENT '骑手送达时间',
  `create_min_money` double(3,2) DEFAULT NULL COMMENT '最小配送金额',
  `delivery_money` double(2,2) DEFAULT NULL COMMENT '配送费',
  `trade_no` varchar(32) DEFAULT NULL COMMENT '第三方流水号',
  `status` varchar(1) DEFAULT NULL COMMENT '9:已取消 0:全部 1待付款 2收货中 3待评价 4已评价  ',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '订单创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';

