-- Records of sys_user_role
-- ----------------------------

-- ----------------------------
-- Table structure for sys_user_role_copy
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_role_copy`;
CREATE TABLE `sys_user_role_copy` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `role_id` varchar(32) DEFAULT NULL COMMENT '角色id',
  PRIMARY KEY (`id`),
  KEY `index2_groupuu_user_id` (`user_id`) USING BTREE,
  KEY `index2_groupuu_ole_id` (`role_id`) USING BTREE,
  KEY `index2_groupuu_useridandroleid` (`user_id`,`role_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户角色表';

-- ----------------------------
-- Records of sys_user_role_copy
-- ----------------------------

-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` varchar(32) NOT NULL COMMENT 'ID',
  `group_id` varchar(32) DEFAULT NULL COMMENT '组别ID',
  `username` varchar(32) DEFAULT NULL COMMENT '用户名',
  `realname` varchar(32) DEFAULT NULL COMMENT '真实姓名',
  `nickname` varchar(50) DEFAULT NULL COMMENT '昵称',
  `age` varchar(3) DEFAULT NULL,
  `password` varchar(32) DEFAULT NULL COMMENT '密码',
  `salt` varchar(30) DEFAULT NULL COMMENT '密码盐',
  `user_type` varchar(1) NOT NULL DEFAULT '0' COMMENT '用户类型  0/普通用户,1/骑手',
  `email` varchar(100) DEFAULT NULL COMMENT '电子邮箱',
  `mobile` varchar(11) DEFAULT NULL COMMENT '手机号',
  `avatar` varchar(255) DEFAULT NULL COMMENT '头像',
  `user_level` tinyint(1) NOT NULL DEFAULT '0' COMMENT '等级',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '性别  0/男,1/女',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `bio` varchar(100) DEFAULT NULL COMMENT '格言',
  `user_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '余额',
  `score` int(10) NOT NULL DEFAULT '0' COMMENT '积分',
  `success_ions` int(10) NOT NULL DEFAULT '1' COMMENT '连续登录天数',
  `maxsuccess_ions` int(10) NOT NULL DEFAULT '1' COMMENT '最大连续登录天数',
  `prev_time` int(10) NOT NULL DEFAULT '0' COMMENT '上次登录时间',
  `login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `loginip` varchar(50) DEFAULT NULL COMMENT '登录IP',
  `loginfailure` tinyint(1) DEFAULT '0' COMMENT '失败次数',
  `joinip` varchar(50) DEFAULT NULL COMMENT '加入IP',
  `join_time` datetime DEFAULT NULL COMMENT '加入时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '编辑人',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态(1：正常  2：冻结 ）',
  `del_flag` varchar(1) NOT NULL DEFAULT '0' COMMENT '删除状态  0/正常,1/已删除',
  `inviter_id` varchar(32) DEFAULT NULL COMMENT '邀请人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员表';

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for user_account
-- ----------------------------
DROP TABLE IF EXISTS `user_account`;
CREATE TABLE `user_account` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `vip_flag` varchar(1) DEFAULT NULL COMMENT '0:非会员 1：会员',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `money` double(10,2) DEFAULT '0.00' COMMENT '余额',
  `account_type` varchar(1) DEFAULT NULL COMMENT '1支付宝  2微信',
  `account_no` varchar(50) DEFAULT NULL COMMENT '账号 支付账号或微信账号或银行卡号',
  `pay_password` varchar(32) DEFAULT NULL COMMENT '支付密码',
  `salt` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '密码盐',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户账户表';

-- ----------------------------
-- Records of user_account
-- ----------------------------

-- ----------------------------
-- Table structure for user_account_bill
-- ----------------------------
DROP TABLE IF EXISTS `user_account_bill`;
CREATE TABLE `user_account_bill` (
  `id` varchar(32) DEFAULT NULL COMMENT '主键id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `before_money` double(10,2) DEFAULT NULL COMMENT '操作前金额',
  `change_money` double(10,2) DEFAULT NULL COMMENT '变化金额',
  `after_money` double(10,2) DEFAULT NULL COMMENT '操作后金额',
  `consume_type` varchar(1) DEFAULT NULL COMMENT '消费方式 0：钱包 1：微信 2：支付宝',
  `sign` varchar(1) DEFAULT '' COMMENT '标志符 + -',
  `bill_type` varchar(1) DEFAULT NULL COMMENT '1:充值 2：消费',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `trade_no` varchar(128) DEFAULT NULL COMMENT '支付宝交易号',
  `receipt_pay_amount` double(10,2) DEFAULT NULL COMMENT '实收金额',
  `buyer_pay_amount` double(10,2) DEFAULT NULL COMMENT '用户实际付款金额'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户账户流水表';

-- ----------------------------
-- Records of user_account_bill
-- ----------------------------

-- ----------------------------
-- Table structure for user_address
-- ----------------------------
DROP TABLE IF EXISTS `user_address`;
CREATE TABLE `user_address` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `detailed_address` varchar(100) DEFAULT NULL COMMENT '详细地址',
  `del_flag` varchar(1) DEFAULT NULL COMMENT '是否删除',
  `default_flag` varchar(1) DEFAULT NULL COMMENT '是否默认（1：默认）',
  `lng` double(10,6) DEFAULT NULL COMMENT '经度',
  `lat` double(10,6) DEFAULT NULL COMMENT '纬度',
  `type` varchar(1) DEFAULT NULL COMMENT '地址类型：1-公司 2-家 3-学校',
  `areap` varchar(32) DEFAULT NULL COMMENT '省份',
  `areac` varchar(32) DEFAULT NULL COMMENT '城市',
  `areax` varchar(32) DEFAULT NULL COMMENT '县（区）',
  `address_label` varchar(32) DEFAULT NULL COMMENT '标签',
  `reciver_name` varchar(32) DEFAULT NULL COMMENT '收货人姓名',
  `reciver_telephone` varchar(16) DEFAULT NULL COMMENT '收货人电话',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户地址表';

-- ----------------------------
-- Records of user_address
-- ----------------------------

-- ----------------------------
-- Table structure for user_announcement
-- ----------------------------
DROP TABLE IF EXISTS `user_announcement`;
CREATE TABLE `user_announcement` (
  `id` varchar(32) NOT NULL,
  `titile` varchar(100) DEFAULT NULL COMMENT '标题',
  `msg_content` text COMMENT '内容',
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `sender` varchar(100) DEFAULT NULL COMMENT '发布人',
  `send_status` varchar(10) DEFAULT NULL COMMENT '发布状态（0未发布，1已发布，2已撤销）',
  `send_time` datetime DEFAULT NULL COMMENT '发布时间',
  `cancel_time` datetime DEFAULT NULL COMMENT '撤销时间',
  `img_url` varchar(128) DEFAULT NULL COMMENT '图片',
  `del_flag` varchar(1) DEFAULT '0' COMMENT '删除状态：0/已删除,1/正常',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户通告表';

-- ----------------------------
-- Records of user_announcement
-- ----------------------------

-- ----------------------------
-- Table structure for user_cart
-- ----------------------------
DROP TABLE IF EXISTS `user_cart`;
CREATE TABLE `user_cart` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `checked_flag` varchar(1) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '是否选中 0未选中 1选中',
  `goods_id` varchar(32) DEFAULT NULL COMMENT '商品id',
  `store_id` varchar(32) DEFAULT NULL COMMENT '商户id',
  `goodst_specid` varchar(32) DEFAULT NULL COMMENT '规格id',
  `goods_num` int(5) DEFAULT NULL COMMENT '商品数量',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `index_user_name` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='购物车';

-- ----------------------------
-- Records of user_cart
-- ----------------------------

-- ----------------------------
-- Table structure for user_evaluate
-- ----------------------------
DROP TABLE IF EXISTS `user_evaluate`;
CREATE TABLE `user_evaluate` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `username` varchar(32) DEFAULT NULL COMMENT '用户名',
  `belong_id` varchar(32) DEFAULT NULL COMMENT '商家id',
  `storename` varchar(32) DEFAULT NULL COMMENT '门店名称',
  `star_count` varchar(1) DEFAULT NULL COMMENT '星级',
  `content` text COMMENT '评论内容',
  `evaluate_type` varchar(1) DEFAULT NULL COMMENT '0：评论商家 1：评论骑手',
  `img_url` varchar(128) DEFAULT NULL COMMENT '用户上传图片',
  `del_flag` varchar(1) DEFAULT '1' COMMENT '是否被删除 0：已删除 1：未删除',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户评价表';

-- ----------------------------
-- Records of user_evaluate
