-- ----------------------------
-- Table structure for user_invoice
-- ----------------------------
DROP TABLE IF EXISTS `user_invoice`;
CREATE TABLE `user_invoice` (
  `id` varchar(32) NOT NULL COMMENT '主键id',
  `user_id` varchar(32) DEFAULT NULL COMMENT '用户id',
  `username` varchar(32) DEFAULT NULL,
  `invoice_titile_id` varchar(64) DEFAULT NULL COMMENT '纳税人名称',
  `invoice_type` varchar(1) DEFAULT NULL COMMENT '发票类型（个人:0  公司:1）',
  `invoice_money` double(10,2) DEFAULT NULL COMMENT '开票金额',
  `invoice_content` varchar(64) DEFAULT NULL COMMENT '发票内容',
  `phone` varchar(11) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `mailing_address` varchar(64) DEFAULT NULL COMMENT '邮寄地址',
  `paper_flag` varchar(1) DEFAULT NULL COMMENT '0：不是纸质发票 1：是',
  `email` varchar(32) DEFAULT NULL COMMENT '邮箱',
  `status` varchar(1) DEFAULT NULL COMMENT '0：失败 1 成功',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `index_user_name` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户发票表';

-- ----------------------------
-- Records of user_invoice
